<div class="entities" style="line-height: 2.5; direction: ltr">DB00171 - sensitive potassium channels ( K ( DB00171 ) ) in retina : a key role for delayed ischemic tolerance . The objectives of the present study were to determine the localization of K ( DB00171 ) channels in normal retina and to evaluate their potential roles in ischemic preconditioning ( IPC ) in a rat model of ischemia induced by increased intraocular pressure ( IOP ) . Brown Norway rats were subjected to sublethal 3 - , lethal 20 - and 40 - min ischemia and the functional recovery was evaluated using electroretinography . The time interval between ischemic insults ranged from 1 to 72 h . The effects of K ( DB00171 ) channel blockade on IPC protection were studied by treatment with 0.01 % glipizide . IPC was mimicked by injection of K ( DB00171 ) channel openers of 0.01 % ( - ) cromakalim or 0.01 % P1060 72 h before 20 - min ischemia . Co-expression of K ( DB00171 ) channel subunits Kir 6.2 / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q09428
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 was observed in the retinal pigment epithelium , inner segments of photoreceptors , outer plexiform and ganglion cell layers and at the border of the inner nuclear layer . In contrast to a 20 - or 40 - min ischemia , a 3 - min ischemia induced no alteration of the electroretinogram ( ERG ) and constituted the preconditioning stimulus . An ischemic challenge of 40 min in preconditioned rats induced impairment of retinal function . However , animals preconditioned 24 , 48 and 72 h before 20 - min ischemia had a significant improvement of the ERG . ( - ) Cromakalim and P1060 mimicked the effect of IPC . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01067
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 significantly suppressed the protective effects of preconditioning . In conclusion , activation of K ( DB00171 ) channels plays an important role in the mechanism of preconditioning by enhancing the resistance of the retina against a severe ischemic insult .</div>

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">A review of the use of frovatriptan in the treatment of menstrually related migraine . Menstrual migraine ( MM ) is a highly prevalent condition associated with considerable disability . Migraine attacks occur exclusively around the menstrual period in approximately 10 % of women with migraine , that is , pure menstrual migraine , while at least 50 % of them also experience migraine at other times of the month , that is , menstrually related migraine ( MRM ) . The therapeutic approach to patients with MRM is based on treatment of the attack , or prophylactic strategies . Triptans are recommended as first-line treatments for moderate to severe migraine attacks , including MM . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00998
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is one of the newest triptans . Its high affinity for 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P28222
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / 1D receptors and long half-life contribute to its distinctive clinical effect , characterized by a more sustained and prolonged effect than other triptans . Indeed , frovatriptan proved to be effective in treating the acute attack , but was particularly effective in the short-term preventive therapy of MM . In addition , frovatriptan is one of the safest triptans , with the lowest risk of treatment-emergent adverse events . Following extensive evidence from randomized pharmacological trials , frovatriptan has now gained a grade A recommendation from the guidelines for short-term prophylaxis of MM . Recent post-hoc analyses of direct comparative trials also suggest that frovatriptan might have an important role in the acute treatment of MRM . In these studies , frovatriptan showed pain relief and pain-free rates similar to those of zolmitriptan , rizatriptan , and almotriptan , but with significantly lower recurrence rates . More well-designed , randomized , prospective studies , specifically enrolling women with MM , will be needed in the near future to confirm the efficacy of frovatriptan in this migraine subtype .</div>

<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 / 1D receptors .

 has been well tolerated in humans and efficacious in reducing headache pain and duration in clinical trials , which have also indicated that dose adjustments for age or gender are not necessary for the drug . Patients have found the use of frovatriptan acceptable over the long-term , and overall a low-incidence of adverse effects has been reported . Though not a prophylactic , frovatriptan has demonstrated the potential to significantly improve the therapeutic approaches to the treatment of migraine .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Estrogen regulation of uterine genes in vivo detected by complementary DNA array . INTRODUCTION : In the present study , our aim was to identify differentially expressed genes involved in estrogen actions at the endometrium level in rats . METHODS : Thirty adult rats were ovariectomized four days prior to drug administration for 48 days . Rats were divided in 2 groups : I , control and II , conjugated equine estrogens ( CCE ) . Total RNA was isolated from uterus , and differential expression was analyzed by array technology and RT-PCR . RESULTS : A total of 32 candidate genes were shown to be upregulated or downregulated in groups I or II . Among them , differential expression was already confirmed by RT-PCR for

 , c-kit , and

 , genes whose expression was up regulated during CCE therapy , and casein kinase II and serine kinase expression was the same level in both groups . CONCLUSION : We have demonstrated that cDNA array represents a powerful approach to identify key molecules in the estrogens therapy . A number of the candidates reported here should provide new markers that may contribute to the detection of target estrogen receptor . This information may also aid the development of new approaches to therapeutic intervention .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Correcting human mitochondrial mutations with targeted RNA import . Mutations in the human mitochondrial genome are implicated in neuromuscular diseases , metabolic defects , and aging . An efficient and simple mechanism for neutralizing deleterious mitochondrial DNA ( mtDNA ) alterations has unfortunately remained elusive . Here , we report that a 20 - ribonucleotide stem-loop sequence from the H1 RNA , the RNA component of the human RNase P enzyme , appended to a nonimported RNA directs the import of the resultant RNA fusion transcript into human mitochondria . The methodology is effective for both noncoding RNAs , such as tRNAs , and mRNAs . The RNA import component , polynucleotide phosphorylase ( Q8TCS8 ) , facilitates transfer of this hybrid RNA into the mitochondrial matrix . In addition , nucleus-encoded mRNAs for mitochondrial proteins , such as the mRNA of human mitochondrial ribosomal protein 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 (

</mark>
 ) , contain regulatory sequences in their 3 ' - untranslated region ( UTR ) that confers localization to the mitochondrial outer membrane , which is postulated to aid in protein translocation after translation . We show that for some mitochondrial-encoded transcripts , such as 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , a 3 ' - UTR localization sequence is not required for mRNA import , whereas for corrective mitochondrial-encoded tRNAs , appending the 3 ' - UTR localization sequence was essential for efficient fusion-transcript translocation into mitochondria . In vivo , functional defects in mitochondrial RNA ( mtRNA ) translation and cell respiration were reversed in two human disease lines . Thus , this study indicates that a wide range of RNAs can be targeted to mitochondria by appending a targeting sequence that interacts with Q8TCS8 , with or without a mitochondrial localization sequence , providing an exciting , general approach for overcoming mitochondrial genetic disorders .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Fluorescence energy transfer analysis of calmodulin-peptide complexes . The interactions between calmodulin and the tryptophan residues of synthetic peptides corresponding to the calmodulin binding domains of skeletal muscle myosin light-chain kinase and the plasma membrane calcium pump were examined . The single tryptophan residue contained in each peptide became relatively immobilized and inaccessible to iodide ion upon binding to calmodulin , indicating that the indole side chain was inserted into a hydrophobic cleft in the surface of calmodulin . Fluorescence energy transfer from peptidyl tryptophan residues to an AEDANS moiety attached to cysteine - 26 of spinach calmodulin was measured . Included in these analyses was a tryptophan-containing peptide analog of the calmodulin binding domain of neuromodulin . These data indicated that the indole ring of each peptide inserted 32-35 A away from cysteine - 26 and may therefore interact with the carboxyl-terminal lobe of P62158 in its &quot; bent &quot; conformation [ Persechini &amp; Kretsinger ( 1988a ) J . Cardiovasc . Pharmacol . 12 ( Suppl 5 ) , S1 - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ; Ikura et al . ( 1992 ) Science 256 , 632-638 ; Vorherr et al . ( 1992 ) Eur . J . Biochem . 204 , 931-937 ] . The interchange of tryptophan - 3 and phenylalanine - 21 of the calcium pump peptide increased the efficiency of energy transfer to the AEDANS-moiety approximately 12 - fold , reducing the calculated distance to 20 A . These data suggest that phenylalanine - 21 of the calcium pump peptide interacts with the hydrophobic cleft in the amino-terminal lobe of P62158 .</div>

<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00998
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is one of the most recent serotonin receptor agonists to receive FDA , approved labelling for use in the acute management of migraine with or without aura in adults . The mechanism of action of frovatriptan is thought to be similar to that of a serotonin agonist . However , frovatriptan has distinctive pharmacokinetic and pharmacologic properties , chiefly , a high affinity for serotonin receptors 1B and 1D and a long elimination half-life ; frovatriptan was shown to be more selective for cerebral than coronary arteries , a property which makes frovatriptan more favourable in patients at risk of coronary artery disease . Additionally , frovatriptan has a half-life of approximately 25 h , substantially longer than that of any other agent within its class . This property makes frovatriptan suitable for patients who typically suffer migraines of long duration and / or those who suffer migraine recurrence . The efficacy of frovatriptan in the treatment of acute migraine was demonstrated in five double-blind , randomised , placebo-controlled trials . At 2h , headache response rates for frovatriptan 2.5 mg ranged from 38 to 40 % compared to 22-35 % for placebo . Headache recurrence for frovatriptan 2.5 mg at 24h ranged from 9 to 14 % compared with 18 % in placebo subjects .

</mark>
 has no clinically significant pharmacokinetic interactions with drugs used for migraine prophylaxis or with commonly prescribed medications . Adverse effects of frovatriptan including dizziness , paresthesia , dry mouth , fatigue and flushing were generally mild and well tolerated . Given the fact that patient response to serotonin agonists is individualised , and selecting an effective agent may involve trial and error , frovatriptan is a welcome alternative in the acute management of migraine .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Effects of external calcium on the biotransformation of DB06749 to ginsenoside Rd by Paecilomyces bainier 229-7 . DB01373 is a known signalling molecule in eukaryotic cells and plays a central role in the regulation of many cellular processes . In the following study , we report on the effect of external calcium treatments on the biotransformation of DB06749 to ginsenoside Rd by Paecilomyces bainier 229-7 . We observed that the intracellular calcium content of P . bainier 229-7 mycelia was increased in response to exposure to high external Ca ( 2 + ) concentrations . Both ginsenoside Rd biotransformation and -glucosidase activity were both found to be dependent on the external calcium concentration . At an optimal Ca ( 2 + ) concentration of 45 mM , maximal ginsenoside Rd bioconversion rate of 92.44 % was observed and maximal -glucosidase activity of 0.1778 U was reached in a 72 - h biotransformation . The Ca ( 2 + ) channel blocker Verapamil blocked the trans-membrane influx of calcium and decreased ginsenoside Rd biotransformatiom . In addition , -glucosidase activity and ginsenoside Rd content decreased by 36.0 and 29.2 % respectively after a 72 - h incubation in the presence of 0.05 mM P62158 ( P62158 ) antagonist

</mark>

<div class="entities" style="line-height: 2.5; direction: ltr">Pharmacokinetic evaluation of frovatriptan . INTRODUCTION : Migraine is the most common painful neurological disorder , affecting 13 % of the general population . Triptans represent a powerful pharmacological tool in acute migraine treatment , however , a significant portion of treated patients can not have access to this class due to possible adverse affects . Today , a total of seven DB00669 molecules are available , representing a commonly prescribed migraine treatment . Although there is a need of extensive use of triptans , only 25 % of migraine patients are using triptans . AREAS COVERED : This review includes triptans and evidence for the use of frovatriptan . A systematic approach is used to discuss the pharmacodynamic and pharmacokinetic aspects of frovatriptan , considering the emerging data on the clinical efficacy of frovatriptan in the treatment of migraine and cluster headaches . The data were obtained by searching the following key words in MEDLINE : pharmacokinetic , pharmacodynamic , triptans , frovatriptan , migraine , menstrual migraine , relatively to the period 1988 - 2011 . EXPERT OPINION : 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 has been developed in order to improve safety and efficacy of triptans . It shows a favorable tolerability and efficacy profile , limited to 24/48- h headache recurrence , when compared with other triptans . Preclinical data suggest that the pharmacokinetic profile of frovatriptan may differ from other available triptans . In fact , among triptans , frovatriptan showed the highest potency at the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 receptor ( 8.2 ) and the longer half-life ( 26 h ) . These parameters determine the clinical properties of frovatriptan ; in particular the lowest rate of headache recurrence in comparison with other triptans .</div>

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 receptors in DB00669 - induced contractile responses in guinea-pig isolated iliac artery . Using a series of triptans we characterized in vitro the 5 - hydroxytryptamine ( 5 - HT ) receptor that mediates the contraction in guinea-pig iliac arteries moderately precontracted by prostaglandin F2alpha ( PGF 2alpha ) . Additionally , we investigated by reverse-transcriptase polymerase chain reaction ( RT-PCR ) which DB00669 - sensitive receptor is present in this tissue . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , zolmitriptan , rizatriptan , naratriptan , sumatriptan , and almotriptan contracted guinea-pig iliac arteries with pD2 values of 7.52+ / -0.04 , 6.72+ / -0.03 , 6.38+ / -0.06 , 6.22+ / -0.05 , 5.86+ / -0.05 and 5.26+ / -0.04 respectively . For comparison , the pD2 values for 5 - HT and 5 - carboxamidotryptamine ( 5 - CT ) were 7.52+ / -0.02 and 7.55+ / -0.03 respectively . In contrast to all other triptans tested , the concentration-response curve for eletriptan was biphasic ( first phase : 0.01- 3 microM , pD2 approximately 6.6 ; second phase : &gt; or = 10 microM ) . Contractions to 5 - HT , 5 - CT , frovatriptan , zolmitriptan , rizatriptan , naratriptan , sumatriptan , almotriptan , and eletriptan ( first phase ) were antagonized by the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P28222
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / 1D receptor antagonist GR127935 ( 10 nM ) and the

 receptor antagonist SB216641 ( 10 nM ) . RT-PCR studies in guinea-pig iliac arteries showed a strong signal for the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 receptor while expression of

 and

 receptors was not detected in any sample . The present results demonstrate that DB00669 - induced contraction in guinea-pig iliac arteries is mediated by the

 receptor . The guinea-pig iliac artery may be used as a convenient in vitro model to study the ( cardio ) vascular side-effect potential of anti-migraine drugs of the DB00669 family .</div>
